INSERT INTO `rooms` (`id`, `name`, `slug`, `avatar`, `description`, `city_id`, `district_id`, `wards_id`, `price`, `range_price`, `range_area`, `status`, `hot`, `area`, `count_view`, `apartment_number`, `full_address`, `contents`, `time_start`, `time_stop`, `category_id`, `service_hot`, `auth_id`, `map`, `subject_id`, `video_link`, `created_at`, `updated_at`) VALUES
(1, 'Cực phẩm KTX, Phòng trọ, Sang, Xịn, Mịn Giá siêu rẻ tại Thủ Đức', 'cuc-pham-ktx-phong-tro-sang-xin-min-gia-sieu-re-tai-thu-duc', NULL, '> Giá trọn gói, không phát sinh bất cứ khoản phí nào nữa.<br />\n*** Miễn phí :<br />\n- Để xe máy ( Để xe trong sân cực rộng và thoáng)<br />\n- Điện, nước.<br />\n- Wifi, rác, vệ sinh - Nước uống. ....<br />\n*** Nội thất gồm : - Giường, Chăn, Ga, Gối, Nệm, đèn đọc sách, bàn học, gương trang điểm, tủ quần áo ( mỗi người 2 tủ ), tủ tài chính, tất cả đều là hàng cao cấp ( các bạn xem hình là hiểu, hình thật 100% ). Có phòng nấu ăn và phòng sinh hoạt chung - Máy lạnh, máy giặt, tivi, tủ lạnh ( mỗi phòng 1 tủ để trong phòng ) không thiếu bất cứ thứ gì. - Khoá Vân tay 2 chiều. - Tolet riêng trong phòng ( có nước nóng năng lượng mặt trời ). ***** Đặc biệt: Dịch vụ vệ sinh miễn phí Tollet , phòng, hành lang 2 lần 1 tuần. Cảm ơn các bạn đã xem tin. Nếu xem phòng vui lòng call :<br />\nMr Bình. 0936.456.678.<br />\nĐịa chỉ : 101 Đường số 8, Phường Linh Đông. Q. Thủ Đức', 1, 1, 1, 1200000, 2, 3, 3, 0, 30, 4, NULL, 'Địa chỉ: 101 Đường số 8, Phường Linh Đông, Quận Thủ Đức, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 5, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:11:34'),
(2, 'PHÒNG SLEEPBOX RIÊNG TƯ ĐẦY ĐỦ TIỆN NGHI RIÊNG TƯ AN NINH 24/24', 'phong-sleepbox-rieng-tu-day-du-tien-nghi-rieng-tu-an-ninh-2424', NULL, 'Sleepbox đầy đủ tiện nghi riêng tư an ninh 24/24.<br />\nKTX sleepbox cao cấp ngay Phổ Quang (50 Phạm Cự Lượng)<br />\nXách vali vào ở ngay.<br />\nVị Trí Trung Tâm Quận tân Bình<br />\nNgay bệnh viện Tâm Anh<br />\nƯu đãi tháng đầu chỉ còn 1.400.000đ cho 10 bạn đăng kí sớm nhất<br />\nGiá bình thường các tháng 1tr6/tháng/người (Bao chi phí điện nước, wifi, máy lạnh, nước uống, rác, ).<br />\nVị trí đẹp thuận lợi:<br />\n- Thuận tiện di chuyển sân bay, Cộng Hòa, Hoàng Hoa Thám, Ngã Tư Phú Nhuận, Quận 1, Quận 11, Quaanj 10...<br />\nPhòng được trang bị sẵn đầy đủ tiện ích:<br />\n- Giường riêng biệt, nệm cao su + drap.<br />\n- Tủ quần áo, tủ đồ riêng.<br />\n- Đèn học, ổ cắm điện.<br />\n- WC riêng, sạch sẽ.<br />\n- Khu vực bếp nấu ăn chung (Đầy đủ dụng cụ - lò vi sóng - bếp - xoong nồi... ).<br />\n- Nước uống I - On miễn phí<br />\n- Wifi siêu tốc.<br />\n- Ra vào cửa vân tay.<br />\n- Bảo vệ, quản lý 24/7.<br />\n- Dọn vệ sinh hằng ngày<br />\n- Thang máy, máy giặt, nơi phơi đồ riêng.<br />\n- Hệ thống camera an ninh.<br />\n- Chỗ sinh hoạt luôn được vệ sinh sạch sẽ.<br />\nĐịa chỉ: Cs1: 50 Phạm Cự Lượng, Phường 2, Tân Bình<br />\nCS2: 69/38/11 Nguyễn Gia Trí, P. 25, Bình Thạnh..<br />\nCS3: 60/18A Huỳnh Khương An, Phường 5, Gò Vấp.<br />\nLiên Hệ: 0896.119.779 ( Zalo + SDT )', 1, 1, 1, 1400000, 2, 2, 3, 0, 25, 0, NULL, 'Địa chỉ: 50 Đường Phạm Cự Lượng, Phường 2, Quận Tân Bình, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 5, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(3, 'PHÒNG KTX ĐẠI HỌC CÔNG NGHIỆP (200M) THANG MÁY, MÁY LẠNH, MÁY GIẶT, WIFI, BẾP', 'phong-ktx-dai-hoc-cong-nghiep-200m-thang-may-may-lanh-may-giat-wifi-bep', NULL, 'Be Home ký túc xá đáng sống.<br />\nNgay cổng 4 đại học Công Nghiệp TP. HCM - 200m. Đi bộ 3P.<br />\nGiờ giấc tự do.<br />\nƯu đãi giá 900k/tháng đầu tiên cho 20 bạn đăng kí sớm nhất.<br />\nĐịa chỉ: 60/18A Huỳnh Khương An, Phường 5, Quận Gò Vấp, TP. HCM.<br />\nKhông gian rộng, có cửa sổ.<br />\nTrang bị giường, nệm và drap mới.<br />\nMáy lạnh.<br />\nNhà vệ sinh riêng.<br />\nCó bếp nấu ăn riêng trong phòng.<br />\nHệ thống wifi công nghiệp mạnh mẽ, ổn định.<br />\nTrang bị máy giặt và nơi phơi đồ.<br />\nKhông gian đảm bảo luôn được vệ sinh sạch sẽ.<br />\nThang máy tiện lên xuống, camera an ninh, bảo vệ 24/7.<br />\nKhu tập thể dục thể thao rộng rãi.<br />\nĐảm bảo điều kiện sống cho bạn một cách tốt nhất.<br />\nPhòng 6 giường.<br />\nGiá: 1tr3/người phòng thường.<br />\n1tr5/người phòng máy lạnh.<br />\nLiên hệ: 0896.119.779 (Zalo + SDT)', 1, 1, 1, 900000000, 8, 2, 3, 0, 28, 0, NULL, 'Địa chỉ: 60/18A Đường Huỳnh Khương An, Phường 5, Quận Gò Vấp, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 5, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(4, 'Cho thuê phòng trọ 128/46 Thiên Phước, P.9, Q.Tân Bình (gần vòng xoay Lê Đại Hành)', 'cho-thue-phong-tro-12846-thien-phuoc-p9-qtan-binh-gan-vong-xoay-le-dai-hanh', NULL, 'Cho thuê phòng trọ gần vòng xoay Lê Đại Hành + Đại Học Bách Khoa.<br />\n. Địa chỉ: 128/46 Thiên Phước, P.9, Q.Tân Bình . .<br />\n. Phòng có tolet riêng, gác lửng + cửa sổ thoáng mát . .<br />\n. Còn p giá từ 2tr<br />\n. Có ban công phơi đồ, wifi 80mb cực mạnh free . .<br />\n. Bạn bè lại chơi nấu ăn trong phòng thoải mái . .<br />\n. Để xe trong sân nhà thoáng mát có mái che & bảo vệ coi<br />\n. Điện 3k5/1 số, nước máy 100k/1 người, giữ xe 120k/1 chiếc . .<br />\n. Vị trị thuận lợi ra Lý Thường Kiệt, Bắc Hải, Lê Đại Hành, Hoàng Văn Thụ , Âu Cơ , 3 tháng 2 , CMT8 chỉ trong 5p .<br />\n. LH : 0906878018 (Hùng) chính chủ .', 1, 1, 1, 2000000, 3, 2, 3, 0, 20, 0, NULL, 'Địa chỉ: 128/46 Đường Thiên Phước, Phường 9, Quận Tân Bình, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 5, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(5, 'PHÒNG TRỌ MỚI SỬA 7/2022 48/13 LƯƠNG THẾ VINH, Phường TÂN THỚI HÒA, TÂN PHÚ (GẦN ĐẦM SEN)', 'phong-tro-moi-sua-72022-4813-luong-the-vinh-phuong-tan-thoi-hoa-tan-phu-gan-dam-sen', NULL, 'Giá Phòng từ 1700k đến xem đảm bảo ưng ý, cam kết hình đúng với thực tế<br />\nPhòng mới sửa chữa cuối tháng 7/2022, địa chỉ 48/13 Lương Thế Vinh Phường Tân Thế Hòa, Q.Tân Phú, nhà hẽm xe hơi lộ giới 5m .<br />\nDiện Tích 12m + 8m ( gác lững )<br />\nPhòng có tolet riêng, cửa sổ, ban công, có phòng dưới trệt<br />\nCho nấu ăn trong phòng, Ở được 2-4 người, bạn bè lại chơi thoãi mái.<br />\nMiễn phí internet, wifi, truyền hình cáp, Camera 15 cái ( an ninh quan sát không góc chết )<br />\nĐể xe trong sân nhà thoáng mát có bảo vệ coi 24/24<br />\nVị trí gần Đầm Sen, thuận tiện qua lại Q.6, Q.11, Tân Phú<br />\nĐiện 3,5k/ 1 ký, nước 70k / 1 người, xe 100k/ 1 chiếc .<br />\nXe để sân sau nhà có người quản lý và trông coi ( không chung chủ ) giúp bạn có cảm giác an toàn, thoải mái<br />\nLH : 0938.864.405 ( Cường )', 1, 1, 1, 1700000, 2, 2, 3, 0, 20, 0, NULL, 'Địa chỉ: 48/13 Đường Lương Thế Vinh, Phường Tân Thới Hòa, Quận Tân Phú, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 5, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(6, 'Cho thuê phòng cao cấp, đầy đủ tiện nghi, như căn hộ, ngay trung tâm Quận 10', 'cho-thue-phong-cao-cap-day-du-tien-nghi-nhu-can-ho-ngay-trung-tam-quan-10', NULL, 'Cho thuê phòng đẹp trung tâm Quận 10 tiện nghi:<br />\n- Địa chỉ 1: 7A/19/19 Thành Thái, P.14, Q.10.<br />\n- Địa chỉ 2: 128 Thành Thái, P.12, Q. 10<br />\nCho thuê phòng trọ nằm cạnh siêu thị Sài Gòn, ngân hàng, gần ngay ngã tư 3/2- Thành Thái - Nguyễn Tri Phương. Gần đại học Kinh Tế TP HCM, Bách Khoa TP HCM, Y Dược. Giao thông thuận tiện, gần chợ trạm xe bus.<br />\nMặt tiền nhà đẹp, hẻm trước nhà 8m xe hơi quay đầu được<br />\nVị trí trung tâm thành phố giáp ngay Quận 1, Quận 3, Tân Bình, Phú Nhuận. Cho bạn thuận tiện trong công việc.<br />\nNhà có thang máy, chỗ để xe rộng rãi.<br />\nPhòng rộng từ 22m2 - 35m2, được trang bị đủ tiện nghi như: (Máy lạnh, tivi, giường nệm, tủ lạnh... ) thiết bị cao cấp mới mua đem lại sự tiện nghi và thoải mái trong căn phòng của bạn, ban chỉ việc xách quần áo đến và ở.<br />\nGiá thuê chỉ từ 4.5 triệu - 7 triệu/tháng. <br />\nChúng tôi cam kết tuyệt đối với bạn rằng! Hình chụp như thế nào thì phòng của bạn như thế đó. Thậm chí có thể đẹp hơn trong thực tế nếu bạn tới xem trực tiếp.<br />\nLiên hệ: A. Khang 0938297275 hoặc 0938. 111. 005', 1, 1, 1, 4500000, 4, 2, 3, 0, 22, 0, NULL, 'Địa chỉ: 128 Đường Thành Thái, Phường 14, Quận 10, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 5, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(7, 'Chỉ 3.9 Triệu, Phòng Rộng Rãi, Đầy Đủ Nội Thất Cơ Bản, Giảm ngay 10% tiền nhà tháng đầu!', 'chi-39-trieu-phong-rong-rai-day-du-noi-that-co-ban-giam-ngay-10-tien-nha-thang-dau', NULL, 'CÒN DUY NHẤT 1 PHÒNG CÓ NỘI THẤT ĐẦY ĐỦ.<br />\nGIÁ CHỈ 3 TRIỆU 900K<br />\nMình chính chủ cho thuê nha!<br />\n————————————————<br />\nMÔ TẢ PHÒNG<br />\n- Phòng rộng rãi, thoáng mát, có gác, có cửa sổ lớn.<br />\n- Full nội thất: tủ quần áo, gối nệm, máy lạnh, kệ bếp, WC riêng...<br />\n- Có chỗ để xe, giờ tự do, không chung chủ.<br />\n- Camera 24/24, cửa khoá vân tay, KV an ninh.<br />\n————————————————<br />\nVỊ TRÍ:<br />\n- Gần Sân Bay Tân Sơn Nhất chỉ 5 phút.<br />\n- Ngay sát bên Trường Cao Đẳng Lý Tự Trọng TPHCM.<br />\n- 1 phút tới Trường Trung cấp Tài Chính - Kế Toán<br />\n- 5 phút tới Trường ĐH Tài Chính Marketing<br />\n- 7 phút tới Trường ĐH Bách Khoa.<br />\n- 2 phút ra Chợ Hoàng Hoa Thám và Coop Food.<br />\n- Di chuyển qua Phú Nhuận, Quận 10 chỉ 5-7 phút.<br />\n- Bước xuống đường là vô vàn tiện ích, quán ăn khắp nơi.<br />\n————————————————<br />\nCHI PHÍ SINH HOẠT:<br />\n- Điện 3.500/kw<br />\n- Nước 100.000/người<br />\n- Chỗ để xe Free<br />\n- Có Wifi đầy đủ.<br />\n————————————————<br />\n“CAM KẾT HÌNH THẬT, NẾU HÌNH KHÔNG ĐÚNG TẶNG NGAY 2 TRIỆU VÌ CÔNG ĐẾN XEM”<br />\n————————————————<br />\nĐịa chỉ: 74 Xuân Diệu, P.4, Tân Bình<br />\nXem phòng liên hệ mình chủ nhà nhé!<br />\n(Có hoa hồng tốt cho MG, miễn đăng tin quảng cáo)', 1, 1, 1, 3900000, 4, 2, 3, 0, 25, 0, NULL, 'Địa chỉ: 74 Đường Xuân Diệu, Phường 4, Quận Tân Bình, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 4, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(8, 'CHO THUÊ PHÒNG TRỌ GIÁ SIÊU RẺ GẦN KHU CÔNG NGHIỆP POUYUEN', 'cho-thue-phong-tro-gia-sieu-re-gan-khu-cong-nghiep-pouyuen', NULL, '+Gần khu công nghiệp Pouyuen và khu công nghiệp Tân Tạo<br />\n+Có wifi<br />\n+Có gác lửng rộng rãi với diện tích 4*1,97=7,88m2<br />\n+Phòng trọ sạch sẽ<br />\n+Diện tích 4m*3m=12m2<br />\n+Có nước máy', 1, 1, 1, 1500000, 2, 1, 3, 0, 12, 0, NULL, 'Địa chỉ: 1665 Đường Tỉnh Lộ 10, Phường Tân Tạo A, Quận Bình Tân, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 4, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(9, 'Căn hộ mới xây 30m2 full nội thất - đường D2 Bình Thạnh', 'can-ho-moi-xay-30m2-full-noi-that-duong-d2-binh-thanh', NULL, 'PHÒNG CHO THUÊ SẠCH ĐẸP, AN NINH, TIỆN NGHI ĐƯỜNG NGUYỄN GIA TRÍ (D2) – BÌNH THẠNH<br />\nChào cả nhà,<br />\nNhằm ổn định nơi ở mới cho các bạn tân sinh viên 2022 cũng như người đi làm, tòa nhà bên mình còn các căn hộ studio cho mọi người lựa chọn như sau:<br />\n- Địa chỉ: 213/8 Nguyễn Gia Trí (D2 cũ), P.25, Q.Bình Thạnh, TP. HCM<br />\nCách Đại học: Hutech 100m (đi bộ đi học), Giao Thông Vận Tải (100m), Ngoại Thương (100m), UEF (300m), Hồng Bàng (300m)<br />\n- Diện tích:<br />\n28m2, 30m2, 33m2, 40m2<br />\nGiá thuê:<br />\n5,000,000 - 6,200,000/ tháng<br />\nCó thể ở từ 4 – 5 người/ phòng<br />\n- Tiện ích căn phòng:<br />\nMáy lạnh 1,5 ngựa tiết kiệm điện<br />\nTủ lạnh<br />\nMáy giặt (ở hành lang)<br />\nCó chỗ phơi đồ rộng rãi, thoáng mát<br />\nTủ quần áo gỗ<br />\nCửa sổ thoáng mát<br />\nBếp nấu ăn + bồn rửa chén<br />\nTủ chén treo tường<br />\nToilet riêng trong phòng + thiết bị vệ sinh hiện đại<br />\nTầng đúc kiên cố rộng 12m2 trong phòng<br />\nWifi riêng cho từng phòng, rất mạnh<br />\n-Tiện ích tòa nhà:<br />\nCó đội ngũ bảo vệ tòa nhà 24/24<br />\nCamera an ninh khắp tòa nhà đảm bảo an ninh tuyệt đối<br />\nCó đội ngũ quản lý toà nhà sẵn sàng hỗ trợ<br />\nThang máy phân tầng hiện đại<br />\nGiờ giấc tự do<br />\nDịch vụ vệ sinh tòa nhà 3 lần/ tuần miễn phí, đảm bảo luôn sạch sẽ, gọn gàng, ngăn nắp<br />\nĐiện: 4k/kw; nước: 100k/ người/ tháng; giữ xe: 150k/ xe/ tháng<br />\nMời cả nhà nhanh tay đặt phòng!<br />\nXin mời liên hệ:<br />\n093 510 1516 (Ms Đào) ; 090 1377 959 (Mr. Huy)', 1, 1, 1, 5000000, 5, 3, 3, 0, 30, 0, NULL, 'Địa chỉ: 213/8 Đường Nguyễn Gia Trí (D2), Phường 25, Quận Bình Thạnh, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 4, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(10, 'PHÒNG SLEEP BOX FULL TIỆN NGHI DÀNH CHO CÁC BẠN SINH VIÊN BÌNH THẠNH, HUTECH, NGOẠI THƯƠNG, GTVT', 'phong-sleep-box-full-tien-nghi-danh-cho-cac-ban-sinh-vien-binh-thanh-hutech-ngoai-thuong-gtvt', NULL, 'Sleepbox đầy đủ tiện nghi riêng tư an ninh 24/24.<br />\nKTX sleepbox cao cấp Nguyễn Gia Trí (D2 cũ) Bình Thạnh ngay Hutech.<br />\nXách vali vào ở ngay.<br />\nCách đại học Hutech 250m.<br />\nCách đại học Ngoại Thương 350m.<br />\nCách đại học GTVT 400m.<br />\nƯu đãi tháng đầu chỉ còn 1.400.000đ cho 10 bạn đăng kí sớm nhất<br />\nGiá bình thường các tháng 1tr8/tháng/người (Bao chi phí điện nước, wifi, máy lạnh, nước uống, rác, ).<br />\nVị trí đẹp thuận lợi:<br />\n- Ngay sau trường ĐH Hutech.<br />\n- Khu vực đông dân cư.<br />\n- Gần các trung tâm thương mại lớn.<br />\n- View nhìn ra Landmark 81.<br />\n- Thuận tiện di chuyển cầu SG, Xa Lộ HN, Q. 9, Phú Nhuận, Gò Vấp phòng * được trang bị sẵn đầy đủ tiện ích:<br />\n- Giường riêng biệt, nệm cao su + drap.<br />\n- Tủ quần áo, tủ đồ riêng.<br />\n- Đèn học, ổ cắm điện.<br />\n- WC riêng, sạch sẽ.<br />\n- Khu vực bếp nấu ăn chung (Đầy đủ dụng cụ - lò vi sóng - bếp - xoong nồi... ).<br />\n- Nước uống I - On miễn phí<br />\n- Wifi siêu tốc.<br />\n- Ra vào cửa vân tay.<br />\n- Bảo vệ, quản lý 24/7.<br />\n- Dọn vệ sinh trong phòng hằng ngày<br />\n- Thang máy, máy giặt, nơi phơi đồ riêng.<br />\n- Hệ thống camera an ninh.<br />\n- Chỗ sinh hoạt luôn được vệ sinh sạch sẽ.<br />\nĐịa chỉ: CS1: 69/38/11 Nguyễn Gia Trí, P. 25, Bình Thạnh..', 1, 1, 1, 1400000, 2, 3, 3, 0, 30, 0, NULL, 'Địa chỉ: 69/38/11 Đường D2, Phường 25, Quận Bình Thạnh, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 4, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(11, 'Phòng trọ mới, sạch đẹp, ngay trung tâm, giá rẻ, chính chủ.', 'phong-tro-moi-sach-dep-ngay-trung-tam-gia-re-chinh-chu', NULL, 'Cho thuê phòng trọ, lầu đúc, sạch đẹp,có sân thượng, ngay trung tâm, đối diện bệnh viện Bình Dân, gần trường học, chợ Vườn Chuối, thuận tiện đi lại cho người đi làm, đi học.Có wifi, truyền hình cáp, nước lạnh, nước nóng năng lượng mặt trời, nhà vệ sinh trong phòng, có chỗ để xe trong nhà không tốn phí( mỗi người một chiếc xe không tốn tiền gửi xe ), an toàn.<br />\nKhu vực yên tĩnh, an ninh.<br />\nĐồng hồ điện, nước riêng.Có thể ở 1 hoặc 2 người.<br />\n-Phòng 24m2 có cửa sổ, giá 3.500.000đ/phòng/tháng ( ở 1 hoặc 2 người).<br />\nPHÒNG TRỐNG-DỌN VÀO Ở NGAY.<br />\nLiên hệ cô Bích Thủy : 0983.344.682<br />\nXem phòng tại 358/4 Điện Biên Phủ P11 Q10 (Khi đến xem phòng xin gọi điện trước).', 1, 1, 1, 3500000, 4, 2, 3, 0, 24, 0, NULL, 'Địa chỉ: 358/4 Đường Điện Biên Phủ, Phường 11, Quận 10, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 4, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(12, 'Phòng máy lạnh, giường, máy giặt đầy đủ tiện nghi', 'phong-may-lanh-giuong-may-giat-day-du-tien-nghi', NULL, 'Bên mình còn 1 phòng dịch vụ bên Quận 7<br />\n1.) Phòng có máy lạnh, giường, máy giặt giá 2tr3 . Địa chỉ: 350 Huỳnh tấn phát Q7<br />\nLiên hệ: 0931313570', 1, 1, 1, 2300000, 3, 2, 3, 0, 20, 0, NULL, 'Địa chỉ: 350 Đường Huỳnh Tấn Phát, Phường Bình Thuận, Quận 7, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 4, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(13, 'Ở ghép trọn gói 700k gần Lotte Mart', 'o-ghep-tron-goi-700k-gan-lotte-mart', NULL, 'Đến Homestay Hoàng Phúc – hệ thống Kytucxa Q7 rẻ nhất Sài Gòn với những căn phòng đẹp lung linh chuẩn 2 sao, đa dạng tiện nghi và bao trọn toàn bộ các chi phí (cam kết 100% không phát sinh).<br />\nCHỈ 9️⃣0️⃣0️⃣.0️⃣0️⃣0️⃣/ THÁNG( KM 200K tháng đầu chỉ còn 7️⃣0️⃣0️⃣.0️⃣0️⃣0️⃣/ THÁNG )<br />\nTIỆN ÍCH NỔI TRỘI TẠI ĐÂY:<br />\nGiường tầng riêng tư, có tủ đồ, móc treo thông minh<br />\nMáy lạnh inverter, wifi tốc độ cao<br />\nNhà vệ sinh riêng, sạch sẽ<br />\nNhân viên dọn phòng hằng ngày<br />\nTự do dùng máy giặt,bình lọc nước<br />\nKhu để xe rộng, được camera giám sát.<br />\n⏰ ⏰ môi trường văn minh<br />\nNgoài ra còn có:<br />\nCamera An ninh, quản lý tâm huyết.<br />\nKhông gian bếp lớn đầy đủ thiết bị.<br />\nCó khu phơi quần áo riêng.<br />\nVị trí ở trung tâm, mức sống dễ chịu, thuận lợi đi lại và ăn uống và rất nhiều các chi nhánh để các chọn lựa gần chỗ làm nơi học.<br />\nĐịa chỉ các cơ sở chi nhánh KTX:<br />\n️CN1: 34 đường 36, P. Tân Quy, Q.7<br />\nCác chi nhánh khác:<br />\n️CN2: 1134/14A Huỳnh Tấn Phát, Q.7<br />\n️CN3: Hẻm 350 Huỳnh Tấn Phát, Q.7<br />\n️CN4: 233/11/6 Nguyễn Trãi, P2, Q.5<br />\n️ CN5: 84 Nguyễn Tất Thành, Q.4<br />\nCÒN CHẦN CHỜ GÌ NỮA NHANH TAY LIÊN HỆ CHO MÌNH 1 CHỖ<br />\nĐiện thoại: 0931313570', 1, 1, 1, 700000000, 8, 2, 3, 0, 20, 0, NULL, 'Địa chỉ: 34 Phố số 36, Phường Tân Quy, Quận 7, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 4, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(14, 'Phòng trọ cho thuê ngắn hạn hoặc dài hạn đầy đủ nội thất, tiện nghi vào ở ngay', 'phong-tro-cho-thue-ngan-han-hoac-dai-han-day-du-noi-that-tien-nghi-vao-o-ngay', NULL, 'Cho thuê phòng trọ ngắn hạn hoặc dài hạn trang bị sẵn full nội thất rất tiện nghi, có thang máy, vào ở ngay.<br />\nVị trí: cách vòng xoay Phú Lâm 200m, gần ngã tư Hậu Giang, gần chợ lớn, khu ăn uống sầm uất. <br />\nNội thất: tivi, tủ lạnh, máy lạnh, giường, nệm, tủ quần áo, bàn trang điểm,... toilet riêng.<br />\nPhòng nhỏ 20m2 (1 giường rộng), giá 3.8 triệu/tháng (ở 2 người)<br />\nPhòng lớn 40m2 (2 giường rộng), giá 6 triệu/tháng (ở 4 người)<br />\nĐiện 3,5k, nước 100k/người, xe 100k/chiếc.<br />\nVệ sinh: 100k. <br />\nLiên hệ: Anh Cảnh - 0913635257 - 0913665257<br />\nHoặc: 028.38858278<br />\nTất cả giảm thêm 10% nếu ở trên 3 tháng.', 1, 1, 1, 3800000, 4, 2, 3, 0, 20, 0, NULL, 'Địa chỉ: 336/10 Nguyễn Văn Luông, Phường 12, Quận 6, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 4, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(15, 'PHÒNG CHO THUÊ NGAY LOTTE Q.7 - CHỈ TỪ 3TR - BAO GIÁ TỐT - Alo 0988.373.731', 'phong-cho-thue-ngay-lotte-q7-chi-tu-3tr-bao-gia-tot-alo-0988373731', NULL, 'Các tiện ích chỉ có ở tại Fullhouse ngay Lotte Q.7. 100% cư dân đều đã chích vacxin 2 mũi và dân trí cao, tuân thủ 5K và pháp luật.<br />\nNgay Lotte Q.7 (đi bộ 2 phút đến đại siêu thị)! Alo ngay: 0988.373.731 Ms Hòa.<br />\nNgay dưới tòa nhà là \"Thiên đường Ốc\" đủ các món ăn ngon<br />\nCăn phòng dành cho bạn thì đầy đủ tiện nghi, tiết kiệm điện và bảo vệ môi trường với hệ đèn LED - Nước nóng năng lượng mặt trời - Máy lạnh Inverter - WC và bếp riêng tiện nghi và tự do.<br />\nTòa nhà luôn được vệ sinh sạch sẽ để bảo vệ sức khỏa toàn bộ dân cư.Tòa nhà xài hệ thống NLMT và máy lạnh Inverter giúp tiết kiệm điện.<br />\nTòa nhà 8 tầng mới xây sạch,đẹp,văn minh thoáng mát, an ninh. Liền kề 5 phút đến Q1, Q4, Q5, Q8, Crescent Mall, SC Vivo, vị trí vàng đẹp Q. 7...Thuê chỗ ở bây giờ cần phải đảm bảo an toàn PCCC tuyệt đối. Tòa nhà căn hộ cho thuê cao cấp của chúng tôi có thẩm duyệt PCCC và đã nghiệm thu PCCC kèm theo bảo hiểm đảm bảo an toàn cho toàn bộ cư dân sống và làm việc tại đây, có an cư, an toàn mới lạc nghiệp.<br />\nGiá từ 3.0 - 4.5 triệu/tháng, bao giá tốt khắp khu vực.<br />\nAlo ngay: 0988.373.731 Ms Hòa.<br />\nĐảm bảo 100% sự hài lòng.<br />\n80 Đường Số 03, P. Tân Kiểng, Q. 7 - LH: 0988.373.731 Ms Hòa.', 1, 1, 1, 3000000, 4, 2, 3, 0, 25, 0, NULL, 'Địa chỉ: 80 Đường số 3, Phường Tân Kiểng, Quận 7, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 1, 4, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
