(29, 'Nhà cấp 4 nguyên căn, 47/7 đường Số 2, Quận 2 - Ngay cầu SG', 'nha-cap-4-nguyen-can-477-duong-so-2-quan-2-ngay-cau-sg', NULL, '- Nhà cấp 4 nguyên căn (80) + gác lửng (20).<br />\n- Đường container vào được cách nhà 10m, hẻm xe 6 chỗ vào được.<br />\n- Khu dân cư trí thức, rất ít nhà cho thuê.<br />\n- Cả Quận 2 (Tp Thủ Đức) không tìm được căn nào tốt hơn, không tin cứ đến check.<br />\n- Ở là thích, phù hợp gia đình hoặc nhóm từ 4 - 6 người.<br />\n- Quyết định nhanh thì còn, chậm thì vào ô mất lượt.<br />\n- Có chỗ tập thể dục, trẻ con vui chơi siêu thích.<br />\n- Trong vòng bán kính 200m có Siêu thị Co. Oop, Big C, Metro + 1 chợ truyền thống.<br />\n- 02 Trường mầm non cách nhà 10 m, tiểu học, trung học cơ sở, phổ thông cách nhà 200m.<br />\n- Công viên gần nhà có 05 công viên (bán kính 200m) + công viên Vinhome (qua cầu Sài gòn) - người lớn, trẻ con có full chỗ vui chơi.<br />\n- Có thể dọn vào ở ngay, hợp đồng từ 12 tháng trở lên.<br />\n- Gọi trực tiếp để xem nhà, không tiếp trung gian.<br />\n- Liên hệ: 093 848 5116 (Cô Luật).', 1, 1, 1, 8000000, 6, 7, 3, 0, 80, 0, NULL, '2, Phường Bình An, Quận 2, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 2, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
