(49, 'Căn Hộ Duplex ban công ngay KCX , Phú Mỹ Hưng và các trường ĐH Q7', 'can-ho-duplex-ban-cong-ngay-kcx-phu-my-hung-va-cac-truong-dh-q7', NULL, 'Căn hộ dịch vụ mới xây, Có ban công, full nội thất, có bếp, cửa sổ ban công, ngay sát bên Vincom Nam Long, khu trung tâm Quận 7, cách Phú Mỹ Hưng 3 km. Giá thuê chỉ từ 5.8 tr/tháng.<br />\n1. Vị trí thuận tiện:<br />\n- Địa chỉ : Đường Trần Trọng Cũng ngay khu dân cư Nam Long.<br />\n- Đường rộng 2 ô tô đi được.<br />\n- Sát bên Vincom Nam Long (đường Trần Trọng CUng).<br />\n- Mất 5 phút để ra các trục đường lớn: Trần Trọng cung, Huỳnh Tấn Phát, Lý Phục Man, Nguyễn Thị Thập, Nguyễn Văn Linh, cầu Phú Mỹ.<br />\n- Gần trường ĐH Tôn Đức Thắng, trường ĐH Nguyễn Tất Thành, trường trung cấp kinh tế - kỹ thuật, nhà hàng tiệc cưới Duyên Hải.<br />\n- Tiện ích mua sắm đầy đủ, gì cũng có.<br />\n2. Tiện ích.<br />\n- Nội thất đầy đủ 100%, có bếp.<br />\n- Có tủ áo quần bằng gỗ sang trọng.<br />\n- Tivi truyền hình cáp nhiều kênh, wifi cực mạnh.<br />\n- Máy lạnh tiết kiệm điện, mới 100%.<br />\n- Có máy giặt, máy sấy đầy đủ.<br />\n- Hầm để xe sạch sẽ và rộng rãi.<br />\n- Toilet rộng rãi, sạch sẽ, sang trọng.<br />\n3. An ninh:<br />\n+ Nhà được giám sát bằng hệ thống camera 24/24.<br />\n+ Nằm trong khu quân đội, các cơ quan nhà nước nên rất an ninh.<br />\n+ Ở chung với người có trí thức, ý thức cao.<br />\n4. Giá phòng.<br />\n- 5,8 tr/ tháng.<br />\n- Điện 3.5 nghìn/kwh.<br />\n- Nước: 25 nghìn / m3<br />\n- Phí quản lý: 150k / phòng<br />\n- Máy giặt + sấy 100 nghìn/người.<br />\n* Gọi ngay: 0583.165.215 (Hà Phiếu ) để xem phòng nha các bạn.', 1, 1, 1, 5800000, 5, 3, 3, 0, 32, 0, NULL, 'Đường Trần Trọng Cung, Phường Tân Thuận Đông, Quận 7, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 3, 2, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(50, 'Căn Hộ Full Nội Thất Gần ĐH TDTU - RMIT - UFM', 'can-ho-full-noi-that-gan-dh-tdtu-rmit-ufm', NULL, 'CHDV Studio ̣̂ ̂́<br />\nVị trí: Ngay Lotte Mart Q7<br />\nGần đại học TDT, Tài chính - Marketing, Big C, Vincom Trần Trọng Cung, chợ, cửa hàng tiện lợi,...<br />\nCăn hộ full nội thất, cửa sổ, ban công thoáng<br />\nGiờ giấc tự do, không chung chủ<br />\nThang máy rộng<br />\nInternet tốc độ cao<br />\nCamera an ninh<br />\nGiá công khai các dạng:<br />\nDạng phòng Studio Full NT: 4tr - 8tr<br />\nDạng phòng Duplex Full NT: 5tr5 - 7tr5<br />\nDạng phòng 1PN Full NT: 6tr2 - 8tr<br />\n---------------------------------------<br />\nCăn hộ dịch vụ, chung cư, phòng trọ cho thuê<br />\nCall, Imess, Zalo...', 1, 1, 1, 5000000, 5, 3, 3, 0, 35, 0, NULL, 'Đường Nguyễn Thị Thập, Phường Tân Hưng, Quận 7, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 3, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(51, 'Căn Hộ Đầy Đủ Nội Thất Cao Cấp - Thoáng Mát - Ngay Công Viên Phần Mềm Quang Trung', 'can-ho-day-du-noi-that-cao-cap-thoang-mat-ngay-cong-vien-phan-mem-quang-trung', NULL, 'CHO THUÊ CĂN HỘ DỊCH VỤ FULL NỘI THẤT CAO CẤP TẠI QUẬN 12<br />\nTrung Mỹ Tây 14A, phường Trung Mỹ Tây, quận 12<br />\n5.000.000 - 5.500.000 (studio full nội thất)<br />\nNội thất bao gồm: tủ lạnh, bàn ghế, giường nệm, tivi, kệ bếp tủ bếp, tủ quần áo, máy giặt riêng, máy lạnh, bếp từ đơn/đôi (tùy phòng)<br />\nVị trí:<br />\n- Gần bến xe An Sương, siêu thị, khu ăn uống, gần chợ<br />\n- Hẻm thông các đường lớn, có nhiều toà nhà sát bên<br />\n- Khu nhân viên văn phòng, sinh viên rất yên tĩnh, thoải mái.<br />\nCăn hộ rộng, đẹp, mới, sang trọng, thông thoáng, đầy đủ tiện nghi, có các phòng ngủ bên trọng cực thoải mái.<br />\nCó thang máy, wifi riêng từng phòng, nước nóng lạnh<br />\nHầm xe có bảo vệ trông coi 24/7<br />\nGiờ giấc tự do, chìa khóa riêng và có thẻ từ, không chung chủ.<br />\nChi phí khác:<br />\nĐiện: 4000đ/kwh<br />\nNước: 100k/người<br />\nXe: 100k/xe<br />\nPhí dịch vụ: 170k/phòng<br />\nLiên hệ Trang: 0707.142.793 (call/zalo) để được tư vấn và hỗ trợ xem phòng trực tiếp', 1, 1, 1, 5000000, 5, 2, 3, 0, 25, 0, NULL, 'Đường Tô Ký, Phường Trung Mỹ Tây, Quận 12, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 3, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
