(69, 'Tôi. Quốc chính chủ cho thuê mặt bằng mặt tiền Võ Thị Sáu, Quận 1 - 105 - chỉ 30tr/tháng. Liên hệ: 0822141489', 'toi-quoc-chinh-chu-cho-thue-mat-bang-mat-tien-vo-thi-sau-quan-1-105-chi-30trthang-lien-he-0822141489', NULL, 'Tôi, Quốc chính chủ căn nhà mặt tiền 94 Võ Thị Sáu, Tân Định, quận 1. Cho thuê mặt bằng mặt tiền Võ Thị Sáu<br />\nNgang 4,2 dài 25. Diện tích sử dụng lên đến 105<br />\nKhông gian được thiết kế theo phong cách châu âu<br />\nCho thuê làm văn phòng, mặt bằng kinh doanh ( không cho làm quán ăn, quán Coffe vì sợ xuống cấp nhà )<br />\nNgay khu sầm uất, gần trường học, khu ăn uống, công viên…<br />\nThuận tiện di chuyển các quận trung tâm.<br />\nCho thuê hợp đồng dài hạn<br />\nMiễn môi giới<br />\nLiên hệ : 0822141489 ( Quốc )', 1, 1, 1, 30000000, 8, 8, 3, 0, 105, 0, NULL, '94 Đường Võ Thị Sáu, Phường Tân Định, Quận 1, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 4, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
