(71, 'CHO THUÊ MẶT BẰNG 176 CHU VĂN AN, BÌNH THẠNH.', 'cho-thue-mat-bang-176-chu-van-an-binh-thanh', NULL, 'CHO THUÊ MẶT BẰNG 176 CHU VĂN AN, BÌNH THẠNH.<br />\nThông tin chi tiết: NHÀ MẶT TIỀN 176 CHU VĂN AN, BÌNH THẠNH<br />\nThích hợp làm Công ty, Văn phòng, Thẩm mỹ viện, Spa, Showroom....<br />\nDiện tích: 4m x 8m, CÓ TẦNG HẦM ĐỂ XE. CÓ TOLET RIÊNG<br />\nƯu điểm mặt bằng nhà:<br />\n- Có tầng hầm để xe, ô tô đậu trước nhà.<br />\n- Nhà mặt tiền, có vị trí đắc địa trong khu đông dân cư, gần chợ, siêu thị, quán ăn uống, trung tâm thương mại, phòng tập gym… Ngay cửa ngõ thuận tiện đi đến Quận 1, 2, 3, bến xe miền Đông và các tính phía Bắc.<br />\nThanh toán tiền thuê đa dạng theo mỗi 3/6/12 tháng một lần.<br />\nTạo điều kiện thời gian di dời đến.<br />\nHỗ trợ giá trong thời gian đầu khi thuê.<br />\nThông tin liện hệ: Chủ nhà Mr. Vũ. Gọi điện, nhắn tin HOẶC qua zalo theo số đt liên hệ.', 1, 1, 1, 12000000, 7, 3, 3, 0, 35, 0, NULL, '176 Đường Chu Văn An, Phường 26, Quận Bình Thạnh, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 4, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(72, 'Cho thuê mặt bằng khu vực phường 13 Quận Tân Bình', 'cho-thue-mat-bang-khu-vuc-phuong-13-quan-tan-binh', NULL, '- Cho thuê nhà mặt tiền chiều rộng 3,7 m, dài 23 m.<br />\n- Đường trước nhà rộng 16 m, vỉa hè rộng 4m.<br />\n- Nhà thích hợp cho việc kinh doanh, mở shop, cửa hàng.<br />\n- Nhà được thiết kế để cho thuê mặt bằng ở phía trước, mọi sinh hoạt gia đình ở phía sau bao gồm phòng ngủ, bếp, 2 nhà vệ sinh.<br />\n- Mặt tiền phù hợp với shop thời trang, đại lý vé máy bay, phòng mạch, tiệm làm tóc vv...<br />\n- Nhà nằm cách đường Cộng Hòa 200 m, cách trường Dân Lập Nguyễn Khuyến 200 m, nằm trong khu dân cư sầm uất.<br />\n- Xung quanh có đầy đủ chợ siêu thị, nhà trẻ, trường cấp 1-2-3.<br />\n* Nhà chính chủ miễn tiếp trung gian.<br />\n-<br />\nLH gặp chủ nhà: 0344.268.548 (Cô Vân)', 1, 1, 1, 16000000, 8, 7, 3, 0, 85, 0, NULL, '22A Thân Nhân Trung, Phường 13, Quận Tân Bình, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 4, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(73, 'Cho thuê trang trại chăn nuôi heo, có chuồng heo xây sẵn sức chứa 300 con, hệ thống điện nước đầy đủ', 'cho-thue-trang-trai-chan-nuoi-heo-co-chuong-heo-xay-san-suc-chua-300-con-he-thong-dien-nuoc-day-du', NULL, 'Cần cho thuê trang trại chăn nuôi heo, gấn trung tâm khu du lịch Bửu Long, Đồng Nai.<br />\nChuồng xây sẵn, hệ thống điện nước đầy đủ.<br />\nCó nhà cấp 4 ở lại, tiện sinh hoạt, chăn nuôi, thích hợp cho gia đình yêu thích nông nghiệp, muốn phát triển mô hình vườn, ao , chuồng,...<br />\nLiên hệ: Cô Thanh 0913609230 hoặc anh Anh 0903627665', 1, 1, 1, 5000000, 5, 10, 3, 0, 1000, 0, NULL, 'Đường Bửu Long, Xã Tân Bình, Huyện Vĩnh Cửu, Đồng Nai', NULL, '2023-12-10 16:04:22', '2024-02-08', 4, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(74, 'Mặt tiền trung tâm tiện mở đại lý Honda, thế giới di động, điện máy xanh,... trung tâm thị trấn Phú GIáo, Bình Dương', 'mat-tien-trung-tam-tien-mo-dai-ly-honda-the-gioi-di-dong-dien-may-xanh-trung-tam-thi-tran-phu-giao-binh-duong', NULL, 'Đất 2 mặt tiền. Mặt tiền đường lớn ĐT741, rộng 26m, mặt tiền hông dài 30m, đường bê tông rộng 10m, thuận tiện làm kho, nhà xưởng, đại lý xe Honda, thế giới di động hoặc mở trạm xăng.<br />\nKhu vực đông dân cư, gần khu công nghiệp, chợ, trường học, trung tâm huyện Phú Giáo<br />\nCho thuê dài hạn, giá thuê 20tr/tháng<br />\nLiên hệ Chị Thanh: 0913 609 230 hoặc 0903627665', 1, 1, 1, 20000000, 8, 10, 3, 0, 750, 0, NULL, 'Đường Tỉnh lộ 741, Xã Phước Hòa, Huyện Phú Giáo, Bình Dương', NULL, '2023-12-10 16:04:22', '2024-02-08', 4, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(75, 'Khai Trương Sàn Làm Văn Phòng Mặt Tiền Trần Quang Khải Gần Cầu Bông', 'khai-truong-san-lam-van-phong-mat-tien-tran-quang-khai-gan-cau-bong', NULL, 'Hiện tại bên e cho thuê 2 sàn làm Văn Phòng ngay mặt tiền Trần Quang Khải gần với Cầu Bông một địa điểm cực kỳ đắc địa.<br />\nSàn 1:<br />\nDiện tích 55 - 25Tr<br />\nSàn 2:<br />\nDiện tích 55 - 25Tr<br />\nSếp nào muốn làm luôn văn phòng rộng rãi dành cho nhân viên của mình thì làm luôn 2 sàn với tổng diện tích là: 110 - 50Tr.<br />\nNgoài ra toàn nhà còn sở hữu một sân thượng với quả Views xin sò để cho có thể hóng mát và thư giãn sau những giờ làm việc chăm chỉ<br />\n️ Liên hệ trực tiếp SĐT gặp E (Trọng An) để được tư vấn, đi xem và sở hữu cho mình một Văn phòng như ý ạ.', 1, 1, 1, 50000000, 8, 8, 3, 0, 110, 0, NULL, 'Đường Trần Quang Khải, Phường Tân Định, Quận 1, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 4, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(76, 'Mặt bằng đẹp cho bán đồ ăn đường vào sân bay', 'mat-bang-dep-cho-ban-do-an-duong-vao-san-bay', NULL, 'Mặt bằng đẹp cho bán hàng ăn sáng trưa, chiều, tối, khuya. Trên đường vào và gần sân bay, nơi có hàng nghìn người có nhu cầu ăn(vì trong sân bay quá đắt) gồm hành khách đi mb, nhân viên sân bay, taxi, grab...mùa covid vẫn bán cả trăm xuất. Mặt tiền có thể sử dụng 7,5m. Vỉa hè 6m. Giá 4 tr/tháng, hợp đồng 1 năm, cọc 1 tháng, trả tiền hàng tháng. Lh a cường 0888880132.', 1, 1, 1, 3000000, 4, 2, 3, 0, 20, 0, NULL, 'Đường Duy Tân, Phường Hòa Thuận Tây, Quận Hải Châu, Đà Nẵng', NULL, '2023-12-10 16:04:22', '2024-02-08', 4, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(77, 'Chủ đầu tư IMG cho thuê mặt bằng tòa nhà Artemis vị trí đẹp nhất quận Thanh Xuân', 'chu-dau-tu-img-cho-thue-mat-bang-toa-nha-artemis-vi-tri-dep-nhat-quan-thanh-xuan', NULL, 'Tòa nhà Artemis, số 3 Lê Trọng Tấn với 4 mặt tiền được tọa lạc tại vị trí đắc địa: Ngã tư Trường Chinh, Tôn Thất Tùng, Lê Trọng Tấn. Với 8 tầng thương mại văn phòng được thiết kế hiện đại, dịch vụ tối ưu, phù hợp làm Ngân hàng, Văn phòng đại diện, Cửa hàng nước giải khát.<br />\n1. Vị trí:<br />\nTòa nhà Artemis tại ngã tư Lê Trọng Tấn, Trường Chinh giao Tôn Thất Tùng,vị trí đắc địa trung tâm quận Thanh Xuân.<br />\n- Đối diện Bệnh viện đại học Y Hà Nội<br />\n- Đối diện bảo tàng Phòng Không Không Quân<br />\n- Ngã tư sở: cách 200m<br />\n- Bến xe Giáp Bát: cách 2km<br />\n- Hồ Hoàn Kiếm: cách 6km<br />\n- Cầu Vĩnh Tuy: cách 4km<br />\n2. Tổng quan:<br />\nTổng diện tích sàn thương mại, văn phòng: 36.000 , view rộng, thoáng, tầm nhìn siêu đẹp bao quanh Hà Nội<br />\n- Diện tích 1 sàn: 4.500 <br />\n- Diện tích cho thuê linh hoạt từ 60-80-100-150-200-500-1000-2000-3000-4000  theo nhu cầu sử dụng của khách hàng<br />\n- Số lượng thang máy: 08 thang máy tốc độ cao<br />\n- Tầng hầm để xe: 03 tầng hầm rộng 10.000 <br />\n- Sảnh văn phòng và thương mại theo tiêu chuẩn văn phòng hạng B, có lễ tân hướng hướng dẫn từ 08h15 17h15<br />\n- An ninh bảo vệ: 24/24 trực tất cả các ngày trong tuần<br />\n- Hệ thống điều hòa Chiller tòan bộ 8 tầng văn phòng thương mại<br />\n- Vệ sinh chuyên nghiệp, sạch sẽ,<br />\n- Chăm sóc khách hàng, Kỹ thuật hỗ trợ 24/7<br />\n- Hệ thống PCCC hiện đại theo tiêu chuẩn mới nhất.<br />\n3. Giá thuê: 350.000 /tháng<br />\n4. Liên hệ:<br />\n- Khách hàng thuê có nhu cầu liên hệ trực tiếp Chủ đầu tư: Ms Thu 0987878949<br />\n- Hoa hồng hấp dẫn từ 1,2 - 2 tháng tiền thuê cho đối tác môi giới.', 1, 1, 1, 350000000, 8, 10, 3, 0, 999, 0, NULL, '3 Phố Lê Trọng Tấn, Phường Khương Mai, Quận Thanh Xuân, Hà Nội', NULL, '2023-12-10 16:04:22', '2024-02-08', 4, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(78, 'Cho thuê nhà phố shophouse Green River Q8-1trệt 1lầu 151 có nội thất cơ bản khu dân cư hiện hữu', 'cho-thue-nha-pho-shophouse-green-river-q8-1tret-1lau-151-co-noi-that-co-ban-khu-dan-cu-hien-huu', NULL, '*Cho thuê 1 trệt 1 lầu 151-183 tại CĂN HỘ - ̣ ̂́ ̂̉ ̣̂ . DT Ngang 8m x dài 10m- gồm 1 tầng trệt có cầu thang lên tầng 2<br />\n*CHO THUÊ NGUYÊN CĂN 20TR/ THÁNG hiện tại có 2 căn block B mặt ngoài, 2 căn block B mặt trong, 2 căn block A mặt ngoài và trong.<br />\n*CHO Thuê tầng trệt 14tr/ tháng<br />\n*SẢN PHẨM AN TOÀN KINH DOANH THUẬN LỢI<br />\nCập nhật tình hình mở bán các căn SHOPHOUSE 1 trệt 1 lầu đang được đưa vào sử dụng hiệu quả tại Green River Quận 8.<br />\n*BLOCK A:<br />\n1. Salon tóc CƯỜNG AN ĐÔNG<br />\n2. Nha Khoa TÂM ĐAN<br />\n3. SPA DAISY<br />\n4. SPA LINH PHẠM<br />\n5. Shop sản phẩm dành cho Mẹ và Con<br />\n6.Cafe Bất động sản<br />\n7. Trà sữa chân châu<br />\n8. Bún đậu mắm tôm<br />\n* BLOCK B:<br />\n1. Cafe NAPOLI<br />\n2. Cafe VIVA coffe<br />\n3. Cafe Kai<br />\n4. Vẽ tranh nghệ thuật sáng tạo cùng bé<br />\n5. Trung tâm tổ chức sự kiện<br />\n*BLOCK C:<br />\n1. Cafe KARA<br />\n2. Cửa hàng tiện lợi Family Mart<br />\n3. Cửa hàng tiện lợi 24h Win mart + Phúc Long coffe<br />\n4. ATM tự động TPBANK<br />\nAnh/Chị có nhu cầu sở hữu hoặc thuê kinh doanh có thể tham khảo.<br />\nKhu vực an ninh, có bảo vệ trực 24/24<br />\n‍️ Liên hệ ngay:***', 1, 1, 1, 20000000, 8, 10, 3, 0, 151, 0, NULL, '2225 Phạm Thế Hiển, Phường 6, Quận 8, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 4, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(79, 'Cho thuê văn phòng ở Toà nhà Landmark 81 Đường Điện Biên Phủ, Phường 22, Quận Bình Thạnh', 'cho-thue-van-phong-o-toa-nha-landmark-81-duong-dien-bien-phu-phuong-22-quan-binh-thanh', NULL, 'Cho thuê văn phòng ở Toà nhà Landmark 81  Đường Điện Biên Phủ, Phường 22, Quận Bình Thạnh<br />\nTổng diện tích 407<br />\nSang trọng hiện đại tiện nghi bật nhất<br />\nmọi chi tiết vui lòng liên hệ trực tiếp Ms. Bình 0909488724', 1, 1, 1, 240000000, 8, 10, 3, 0, 407, 0, NULL, 'Toà nhà Landmark 81 Đường Điện Biên Phủ, Phường 22, Quận Bình Thạnh, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 4, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22'),
(80, 'Cho Thuê Mb VP Cty , Full Nội Thất , Máy Lạnh Các Phòng , 140 , 1T , 1 Lửng , Ngã Tư Bình Phước', 'cho-thue-mb-vp-cty-full-noi-that-may-lanh-cac-phong-140-1t-1-lung-nga-tu-binh-phuoc', NULL, '-Cho thuê Mặt Bằng Trệt và Lửng làm Văn Phòng Cty , nằm trong Toà Nhà Phố Cao Cấp , có đầy đủ nội thất.<br />\n-Vị Trí “ Tuyệt Đẹp “ góc 2 Mặt Tiền , Đông Bắc và Đông Nam phù hợp phong thuỷ với hầu hết các tuổi.<br />\n+ Dt : 140<br />\nGồm : 1 Vp trệt , 2 vp tầng Lửng ( Phòng sếp & phòng họp)<br />\n-Bán kính từ 3km – 5km<br />\n+ Đh Luật , Phạm Văn Đồng , Vạn Phúc City , thuận tiện đi Bình Thạnh , Gò Vấp ..!<br />\n-Dọc theo QL1A :<br />\n+ Về An sương , q12 và Củ chi….!<br />\n+ Về Linh xuân , Xa Lộ Hà Nội , ngã tư thủ đức , chợ đầu mối nông sản.<br />\n-Cách ngã tư Bình Phước chỉ 500m , ngay chân cầu Vĩnh Bình ( qua cầu là Bình Dương ).<br />\n-Giá : 18 Triệu / Tháng . Điện 4k . Nước 20k<br />\n-Phù Hơp làm Vp Cty , IT , Tư Vấn , CSKH , …!<br />\n-Đường trải nhựa 8m , ko ngập , oto có thể ra vào thoải mái , dân cư hiện hửu , an ninh .!<br />\n-- Liên Hệ : Bền Nguyễn , Zalo 0904 509 552 ( Tư Vấn 24/24).', 1, 1, 1, 18000000, 8, 9, 3, 0, 140, 0, NULL, '23/22B 12, Phường Hiệp Bình Phước, Quận Thủ Đức, Hồ Chí Minh', NULL, '2023-12-10 16:04:22', '2024-02-08', 4, 1, 1, NULL, 0, NULL, '2023-12-10 09:04:22', '2023-12-10 09:04:22');
